sys_variable_value.value:
(function execute(inputs, outputs) {
  var reqUtil = new Request()
  var errUtil = new ErrorHandler()
  var response;

  try {
    var request = {
      endpoint: inputs.baseUrl + inputs.resourcePath,
      method: inputs.method,
      mutualAuth: reqUtil.JKS_443,
      token: inputs.token,
      body: inputs.requestBody,
    };

    response = reqUtil.getSuccessfulResponse(request)
    var agencies = JSON.parse(response.body)

   outputs.response_status = response.statusCode
   outputs.response_body = response.body

 } catch (error) {
   errUtil.errorLogger(error)
   throw error
 }

})(inputs, outputs);

